import React from "react";
import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Cloud from "./Cloud";
import SubTitle from "./SubTitle";


function Header() {
  return (
    <div>
      <Navbar sticky="top" bg="#3FC1C9" variant="dark">
          <Container>
              <Navbar.Brand>The Tech PM</Navbar.Brand>
              <Navbar.Toggle aria-controls="basic-navbar-nav" />
              <Navbar.Collapse id="basic-navbar-nav">
              <Nav className="me-auto">
                  <Nav.Link href="#about">About Me</Nav.Link>
                  <Nav.Link href="#work">Work</Nav.Link>
                  <Nav.Link href="#skills">Skills</Nav.Link>
                  <Nav.Link href="#contact">Contact</Nav.Link>
              </Nav>
              </Navbar.Collapse>
          </Container>
      </Navbar>
      <Container fluid className="top-container">
          <Cloud cloudType ="top-cloud" offest="5" />
          <h1>I'm Jenny Hunter</h1>
          <SubTitle text="a senior product manager" />
          <SubTitle text="a CTO and co-founder" />
          <SubTitle text="a woman in STEM" />
          <Cloud cloudType ="bottom-cloud d-none d-md-block" offset="2" />
          <img className ="hero" src="media/path.png" alt="path" />
      </Container>
    </div>
  );
}

export default Header;
